webpackJsonp([0x5ca02f5bc038],{848:function(n,r){n.exports={data:{markdownRemark:{frontmatter:{title:"ОЗЕРО",type:"lyrics"},html:"<h1>ОЗЕРО</h1>\n<section>\n<p>Вечер тих.<br>\nНачерти<br>\nна воде,<br>\nовод где,<br>\nмокрый знак — <br>\nмог ли знать,<br>\nкак вечер их<br>\nтих.</p>\n<p>Мальчик в лодке речку трогал,<br>\nили лодка тянет воду.<br>\nРуки закатав в тюльпаны,<br>\nмальчик тянет одеяло.</p>\n<p>Это солнце в камышах<br>\nПрячет золото в мешках.<br>\nЭто время на воде<br>\nВодомеркой делит день.</p>\n<p>Это цапля — часовой — <br>\nПравой тикает ногой.<br>\nЭто мальчик в лодке лишней<br>\nЗацветает белой вишней.</p>\n<p>Вечер тих.<br>\nНачерти<br>\nна воде,<br>\nовод где,<br>\nмокрый знак — <br>\nмог ли знать,<br>\nкак вечер их<br>\nтих.</p>\n<p>Эту лодку утопи<br>\nуткой пойманной в топи<br>\nи с лягушками из воска<br>\nс головой нырни в извёстку</p>\n<p>Рыбы плавной чешуёй<br>\nВоду гладят под водой<br>\nИ смыкают пузырями<br>\nто, что мы ещё не знаем.</p>\n<p>Это вечер — зелен лён — <br>\nтянет сердце на бутон.<br>\nВ этот вечер, время сквозь<br>\nСердце с озером сплелось.</p>\n</section>"},site:{siteMetadata:{languages:{defaultLangKey:"en",langs:["en","ru"]}}}},pathContext:{slug:"/ru/lyrics/ozero/"}}}});
